import React, { useContext } from "react";
import { FilterDispath } from "../../Context/ContextFilter";
import "./Filter.css";

export default function Filter() {
  const { dispath } = useContext(FilterDispath);
  return (
    <div className="filter_container">
      <div className="filter_btnBox">
        <button onClick={() => dispath({ type: "ALL" })} className="filter_btn">
          All
        </button>
        <button
          onClick={() => dispath({ type: "FURNITURES" })}
          className="filter_btn"
        >
          TV Stand
        </button>
        <button
          onClick={() => dispath({ type: "TV STANDS" })}
          className="filter_btn"
        >
          Coffee Table
        </button>
        <button
          onClick={() => dispath({ type: "COFFEE TABLES" })}
          className="filter_btn"
        >
          Beds
        </button>
        <button
          onClick={() => dispath({ type: "BEDS" })}
          className="filter_btn"
        >
          Seats
        </button>
      </div>
    </div>
  );
}
